import logo from './logo.svg';
import './App.css';
import bg from './img/bg.png';
import { Button, Navbar, Container, Nav } from 'react-bootstrap';
import monitor from './img/monitor.png';
import camera from './img/camera.png';
import politics from './img/politics.png';
import { useState} from "react";
import data from './data.js';


function App() {


  let [shoes] = useState(data) 

  return(
    <div>
       <Navbar bg="light" variant="dar">
        <Container>
          <Navbar.Brand href="#menu">Menu</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="#brunch">Brunch</Nav.Link>
            <Nav.Link href="#search">Search</Nav.Link>
          </Nav>
        </Container>
      </Navbar>

      <div className="main-bg" style={{backgroundImage: 'url('+ bg + ')'}}></div>
      <div className="keyword"></div>
      <div className = 'container'>
        <div className = "row">
          <Card shoes={shoes}></Card>
          <Card shoes={shoes}></Card>
          <Card shoes={shoes}></Card>
          <div className="col-md-4">
          <img src ={camera} width='50' height='50'/>
          <h4>ART</h4>
          </div>
          <div className="col-md-4">
          <img src ={politics} width='50' height='50'/>
          <h4>NEWS</h4>
          </div>
        </div>
      </div>

    </div>




  );
}

function Card(props) {
  return (
    <div className="card">
    <img src ={monitor} width='50' height='50'/>
    <h4>IT</h4>
    <div>{props.shoes[0].price}</div>
    <div>{props.shoes[0].content}</div>
  </div>
  )
}
export default App;
